import Lorem from './Lorem.js';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';
// import SkillsMarquee from './SkillsMarquee'

const TechSkills = () => {
    return (
        <div >
        <Tabs defaultActiveKey="Programming">
            <Tab eventKey="Programming" title="Programming" className='project-tab'>
                <Lorem />
                {/* <SkillsMarquee/> */}
            </Tab>
            <Tab eventKey="Development" title="Development" className='project-tab'>
                <Lorem />
            </Tab>
            <Tab eventKey="Databases" title="Databases" className='project-tab'>
                <Lorem />
            </Tab>
            <Tab eventKey="VersionControl" title="Version Control" className='project-tab'>
                <Lorem />
            </Tab>
            <Tab eventKey="AlsoFamiliarWith" title="Also Familiar With" className='project-tab'>
                <Lorem />
            </Tab>
        </Tabs>
        </div>
    )
}

export default TechSkills
